import './style.css';
import img from './bg_1.svg';

const Home=()=>{


    return (
        <>
            <div className="home_div">
                <div className="home_text">
                    <h1>grow your business with<br />
                    <strong><span>SUBHAM SAHOO</span></strong></h1>
                    <br />
                    <h3>We are team of talented developer making websites</h3>
                    <a href="/">GET STARTED</a>
                </div>
                <div className ="home_img">
                    <img src={img}/>
                </div>
            </div>
        </>
    )
}

export default Home;
